import React from 'react'
import { banner } from '../assets/images'

const Homepage = () => {
  return (
    <section className='max-container h-auto'>
        <img className='absolute h-[80vh] w-full object-center' src={banner} alt="" />
        <div className='h-40 w-40 bg-red-500'>
        </div>
    </section>
  )
}

export default Homepage
